        private async ValueTask<SrsManager> CreateNewSrsInstance(SrsManager sm)
        {
            var rs = new ResponseStruct()
            {
                Code = ErrorNumber.None,
                Message = ErrorMessage.ErrorDic![ErrorNumber.None],
            };
            var check = false;
            ApisResult api;
            foreach (var srs in _srs.Values)
            {
                api = await srs.Ask<ApisResult>(new CheckNewSrsInstancePathRight(sm));

                if (api.Rt is bool value)
                {
                    if(value)
                        check = true;
                }
            }
            if(!check)   
                return null!;

            foreach (var srs in _srs.Values)
            {
                api = await srs.Ask<ApisResult>(new CheckNewSrsInstanceListenRight(sm));

                if (api.Rt is bool value)
                {
                    if (value)
                        check = true;
                }
            }
            if (!check)
                return null!;

            if (!sm.CreateSrsManagerSelf(out rs))
            {
                return null!;
            }

            return sm;
        }
        private List<DriveDiskInfo> GetDriveDisksInfo()
        {
            var disks = new List<DriveDiskInfo>();
            var drives = DriveInfo.GetDrives();
            foreach (var d in drives)
            {
                var ddi = new DriveDiskInfo()
                {
                    Format = d.DriveFormat,
                    VolumeLabel = d.VolumeLabel,
                    Free = (ulong)d.AvailableFreeSpace / 1000 / 1000,
                    Size = (ulong)d.TotalSize / 1000 / 1000,
                    Path = d.Name,
                    RootDirectory = d.RootDirectory.FullName,
                };
                if (ddi.Size > 0 && ddi.Free > 0)
                {
                    disks.Add(ddi);
                }
            }

            return disks;
        }
        private IActorRef SRSManager(string deviceId)
        {
            var d = $"deviceId_{deviceId}";
            if (_srs.ContainsKey(d))
                return _srs[d];
            else
            {
                var s = Context.ActorOf(SRSManagerActor.Prop(_pulsarSystem), d);
                _srs[d] = s;
                return s;
            }

        }
        private async ValueTask<List<OnlineClient>> Sql(string query, string tenant, string namespac, string trinoUrl)
        {
            var option = new ClientOptions
            {
                Server = trinoUrl,
                Execute = query,
                Catalog = "pulsar",
                Schema = $"{tenant}/{namespac}"
            };
            var sql = new SqlInstance(_pulsarSystem.System, option);
            var data = await sql.ExecuteAsync();
            var dvr = new List<OnlineClient>();
            switch (data.Response)
            {
                case StatsResponse stats:
                    _log.Info(JsonSerializer.Serialize(stats, new JsonSerializerOptions { WriteIndented = true }));
                    break;
                case DataResponse dt:
                    for (var i = 0; i < dt.Data.Count; i++)
                    {
                        var ob = dt.Data.ElementAt(i);
                        var json = JsonSerializer.Serialize(ob, new JsonSerializerOptions { WriteIndented = true });
                        dvr.Add(JsonSerializer.Deserialize<OnlineClient>(json)!);
                    }
                    _log.Info(JsonSerializer.Serialize(dt.StatementStats, new JsonSerializerOptions { WriteIndented = true }));
                    break;
                case ErrorResponse er:
                    _log.Info(JsonSerializer.Serialize(er, new JsonSerializerOptions { WriteIndented = true }));
                    break;
            }
            return dvr;
        }
